import React from "react";

function IconVerticalEllipses({ showBoardMenu }) {
  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      width="5"
      height="20"
      style={{ cursor: "pointer" }}
      onClick={showBoardMenu}
    >
      <g fill="#828FA3" fillRule="evenodd">
        <circle cx="2.308" cy="2.308" r="2.308"></circle>
        <circle cx="2.308" cy="10" r="2.308"></circle>
        <circle cx="2.308" cy="17.692" r="2.308"></circle>
      </g>
    </svg>
  );
}

export default IconVerticalEllipses;
